import {createSlice} from  "@reduxjs/toolkit";

let navListReducer=createSlice(
    {
       name:'numReducer',
       initialState:{navList:[]},
       reducers:{
            changeNavList(previoustate,data){
                previoustate.navList=data
            }
       }
    }
)

export let changeNavList

export default navListReducer
